import { useEffect, useState } from "react";

function Popular(){
    const [popular, setPopular] = useState([]);

    useEffect(() => {
        getPopular();
    },[]);

    const getPopular = async () => {
        const api = await fetch(`https://api.spoonacular.com/recipes/random?apiKey=b3360338f3954b3d8ab63e9ada6f4c26&number=5`);
        const data = await api.json();
        setPopular(data.recipes);
    };

    return <div>Popular

        {popular.map((recipe) => {
           return (
            <div key={recipe.id}> 
                <p>{recipe.title}</p>
            </div>
           ); 
        })}
    </div>;
}

export default Popular;
